import "raylib"

fn init() {
    raylib.InitWindow(600, 350, "raylib-umka [core] example - basic window")
}

fn update() {
    raylib.BeginDrawing()
    raylib.ClearBackground(raylib.RAYWHITE)
    raylib.DrawText("Congrats! You created your first raylib-umka window!", 30, 150, 20, raylib.LIGHTGRAY)
    raylib.EndDrawing()
}

fn close() {
    raylib.CloseWindow()
}

fn main(){}
</textarea></div><p><button id=runButton>Run</button><select id=example name=example><option value=example>Load Example</option><option value=core_basic_window>Core: Basic Window</option><option value=shapes_bounding_ball>Shapes: Bounding Ball</option></select></p><div style=text-align:center><canvas class=emscripten id=canvas oncontextmenu=event.preventDefault() tabindex=-1></canvas></div><div class=textarea-wrapper><textarea id=outputTextArea rows=10 spellcheck=false style=width:100%;resize:vertical;background-color:#f5f5f5 readonly></textarea></div><script>const examples={core_basic_window:'import "raylib"\n\nfn init() {\n    raylib.InitWindow(800, 450, "raylib-umka [core] example - basic window")\n}\n\nfn update() {\n    raylib.BeginDrawing()\n    raylib.ClearBackground(raylib.RAYWHITE)\n    raylib.DrawText("Congrats! You created your first raylib-umka window!", 150, 200, 20, raylib.LIGHTGRAY)\n    raylib.EndDrawing()\n}\n\nfn close() {\n    raylib.CloseWindow()\n}\n\nfn main(){}',shapes_bounding_ball:'import "raylib"\n\nconst screenWidth = 800\nconst screenHeight = 450\n\nvar ballPosition:raylib.Vector2\nvar ballSpeed:raylib.Vector2 = raylib.Vector2{5, 4}\nvar ballRadius:int = 20\nvar pause:bool = false\nvar framesCounter:int = 0\n\nfn init() {\n    raylib.InitWindow(screenWidth, screenHeight, "raylib-umka [shapes] example - bouncing ball")\n    raylib.SetTargetFPS(60)\n\n    ballPosition.x = raylib.GetScreenWidth() / 2\n    ballPosition.y = raylib.GetScreenHeight() / 2\n}\n\nfn update() {\n        // Update\n        //-----------------------------------------------------\n        if raylib.IsKeyPressed(raylib.KEY_SPACE) {\n            pause = !pause\n        }\n\n        if !pause {\n            ballPosition.x += ballSpeed.x\n            ballPosition.y += ballSpeed.y\n\n            // Check walls collision for bouncing\n            if ((ballPosition.x >= (raylib.GetScreenWidth() - ballRadius)) || (ballPosition.x <= ballRadius)) {\n                ballSpeed.x *= -1\n            }\n            if ((ballPosition.y >= (raylib.GetScreenHeight() - ballRadius)) || (ballPosition.y <= ballRadius)) {\n                ballSpeed.y *= -1\n            }\n        } else {\n            framesCounter++\n        }\n        //-----------------------------------------------------\n\n        // Draw\n        //-----------------------------------------------------\n        raylib.BeginDrawing()\n\n            raylib.ClearBackground(raylib.RAYWHITE)\n\n            raylib.DrawCircleV(ballPosition, ballRadius, raylib.MAROON)\n            raylib.DrawText("PRESS SPACE to PAUSE BALL MOVEMENT", 10, raylib.GetScreenHeight() - 25, 20, raylib.LIGHTGRAY)\n\n            // On pause, we draw a blinking message\n            if pause && ((framesCounter / 30) % 2 == 0) {\n                raylib.DrawText("PAUSED", 350, 200, 30, raylib.GRAY)\n            }\n\n            raylib.DrawFPS(10, 10)\n\n        raylib.EndDrawing()\n}\n\nfn close() {\n    raylib.CloseWindow()\n}\n\nfn main(){}'};var Module={print:onPrint,printErr:onPrintErr,canvas:document.getElementById("canvas"),onRuntimeInitialized:function(){onRun()}};const tabWidth=4;var runButton=document.getElementById("runButton"),sourceTextArea=document.getElementById("sourceTextArea"),outputTextArea=document.getElementById("outputTextArea"),exampleSelectBox=document.getElementById("example");function onRun(){let e=Module.cwrap("runCode","bool",["string","string"]),n=sourceTextArea.value;outputTextArea.value="",e("playground.um",n)}function onPrint(e,n){outputTextArea.value+=e+"\n",outputTextArea.scrollTop=outputTextArea.scrollHeight,n?console.error(e):console.log(e)}function onPrintErr(e){onPrint(e,!0);var n=e.split(" ");"Error"==n[0]&&void 0!==n[2]&&selectLine(n[2].replace(",","").replace("(",""))}function onKey(e){var n=this.selectionStart,t=this.selectionEnd;if("Tab"==e.key)e.preventDefault(),this.value=this.value.substring(0,n)+" ".repeat(4)+this.value.substring(t),this.selectionStart=this.selectionEnd=n
